import React from "react";
import "./Home.scss";
import Navbar from "../components/navbar/Navbar";
import Featured from "../components/featured/Featured";

const Home = () => {
    return (
        <div className="home">
            <Navbar />

            <Featured type="series" />
        </div>
    );
};

export default Home;
